@Alien_free_i 네..전당신을 보는게 힐링이고 회복임다..
그녀 한복입는거 보는게 힐링이고 행복이고 복지죠...^-^
그걸또 내가 촬영한다? 극ㅡ락!

@usa_hobby01 다른 주제.
한복을 중국이 수입해서 독창적으로 발전시킨게 아니라 그저 중국에 조선족이 있으니 한복자체는 중국의 것이라고 당신들이 주장하니까 분개한거죠.
억지 부릴걸 부리세요.

그런 의미로 다시보는 교집합 한복......
&gt;&gt;짱&lt;&lt;
이라는 말 밖엔...

